import React from 'react';

const Servizi = () => {
  return (
    <div style={styles.container}>
      <h1>I Nostri Servizi</h1>
      <p>Offriamo una vasta gamma di servizi estetici personalizzati per ogni esigenza.</p>
      <ul>
        <li>Trattamenti viso</li>
        <li>Massaggi corpo</li>
        <li>Epilation</li>
      </ul>
    </div>
  );
};

const styles = {
  container: {
    padding: '2rem',
    textAlign: 'center',
  },
};

export default Servizi;
